import React, { Component } from 'react';
import backgroundImage2 from "../../images/background 2.png";
import './timeline.css';
import Navbar from "../navbar";
import TimelineSpecific from './timeline_specific';

class Timeline extends Component {

    constructor(props) {
        super(props);
        this.state = {imageType: backgroundImage2};
    }

    render() {

        return(
    
            <div className="App">

                <img src={backgroundImage2} className="backgroundImage" alt="background wing view"></img>

                <Navbar page={this.props.page} />

                <TimelineSpecific type="Programming"/>

            </div>
    
        )

    }

};

export default Timeline;
